function-block-declaration.unknown-in-function-block:
: Real
   VAR_INPUT 
      inr_Y1 : Real;  
      inr_Y2 : Real;  
      inr_X1 : Real;  
      inr_X2 : Real;  
      inr_X : Real;   
   END_VAR

   VAR_TEMP 
      lr_y_delta : Real; lr_x_delta : Real; lr_m : Real;   
   END_VAR


   lr_y_delta := (inr_Y2 - inr_Y1);
   lr_x_delta := (inr_X2 - inr_X1);

   IF lr_y_delta <> 0 AND lr_x_delta <> 0 THEN
       lr_m := (lr_y_delta / lr_x_delta);
       FC_Scale_linear := (lr_m * (inr_X - inr_X1)) + inr_Y1;
   ELSE
       FC_Scale_linear := 0;
   END_IF;

data-block-declaration.unknown-in-data-block:
mode : UInt; obNbr : OB_ANY; infoData : LTime; returnValue : Int;   
   END_VAR



   mode := 1;
   obNbr := 1;

mode : UInt; obNbr : OB_ANY; infoData : LTime; returnValue : Int;
   END_VAR



   mode := 1;
   obNbr := 1;
